class Movie extends Component {
    render() {
    return (
         <>
        {
         this.props.movie.map((item,idx) => {
         return (
            <li key={idx}>
        <p> {item.date} </p>
        <p>{item.description}</p>
          </li> 
           )
        })
         }

         </>
        )
    }

}
export default Movie;
